IF OBJECT_ID('dbo.proc_transform_35', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_35;
GO
CREATE PROCEDURE dbo.proc_transform_35
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_35
    SET payload = LEFT(payload, 1000) + N'|V4-35|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_35;
END
GO
IF OBJECT_ID('dbo.audit_v4_35', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_35 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_35;
GO

CREATE INDEX IDX_staging_35_payload ON dbo.staging_table_35 (id);
GO
EXEC sp_updatestats;
